import * as React from "react";

function Grid(props) {
  return (
    <svg viewBox="0 0 72.78 72.78" {...props}>
      <g data-name="Layer 3" fill="none" strokeMiterlimit={10}>
        <path
          stroke="#808285"
          d="M15.36 1.15v71.39M29.52 1.15v71.39M43.58 1.15v71.39M57.73 1.15v71.39M.85 57.97h71.39M.85 43.82h71.39M.85 29.76h71.39M.85 15.6h71.39"
        />
        <path
          stroke="#cca7e4"
          strokeWidth={1.07}
          d="M.54.54h71.71v71.71H.54z"
        />
      </g>
    </svg>
  );
}

const MemoGrid = React.memo(Grid);
export default MemoGrid;
